import React, { Component } from 'react';

const events = require("../countdown-list.json");

export default class Countdown extends Component {
    render() {
        console.log(events.map(event => event));
        return (
            <div>
                {events.map(event => 
                    <div>
                        <h1>{event.title}</h1>
                        <h2>{event.month}/{event.day}/{event.year}</h2>
                    </div>
                )}
                <h1>Countdown!</h1>
            </div>
        )
    }
}
